class FormBasic extends Component {
    render() {
        return (
            <form>
                <div>
                    <label>Name : </label>
                    <input type='text'></input>
                </div>
                <div>
                    <label>Comments : </label>
                    <textarea></textarea>
                </div>
            </form>
        )
    }
}

export default FormBasic
